	public void InitializeCustomCode()
	{
		// ** Wizard Insert Location - Do not delete 'Begin/End Wizard Added Variable Initialization' lines **
		// Begin Wizard Added Variable Initialization

		this.QuoteMtl_Column.ColumnChanged += new DataColumnChangeEventHandler(this.QuoteMtl_AfterFieldChange);
		this.edvJobMtl = ((EpiDataView)(this.oTrans.EpiDataViews["JobMtl"]));
 
        this.epiCheckBoxMtlPricing.Click += new System.EventHandler(this.epiCheckBoxMtlPricing_Click);
 
		this.QuoteMtl_Column.ColumnChanging += new DataColumnChangeEventHandler(this.QuoteMtl_BeforeFieldChange);

		//oTrans_adapter_AfterAdapterMethod

		this.oTrans_quoteAsmAdapter = ((EpiBaseAdapter)(this.csm.TransAdaptersHT["oTrans_quoteAsmAdapter"]));
		this.oTrans_quoteAsmAdapter.BeforeAdapterMethod += new BeforeAdapterMethod(this.oTrans_quoteAsmAdapter_BeforeAdapterMethod);

		this.oTrans_quoteAsmAdapter.AfterAdapterMethod += new AfterAdapterMethod(this.oTrans_quoteAsmAdapter_AfterAdapterMethod);
		this.edvJobMtl.EpiViewNotification += new EpiViewNotification(this.edvJobMtl_EpiViewNotification);
		this.oTrans_adapter = ((EpiBaseAdapter)(this.csm.TransAdaptersHT["oTrans_adapter"]));
		//this.oTrans_adapter.AfterAdapterMethod += new AfterAdapterMethod(this.oTrans_adapter_AfterAdapterMethod);
		this.QuoteHed_Column.ColumnChanged += new DataColumnChangeEventHandler(this.QuoteHed_AfterFieldChange);
		this.baseToolbarsManager.ToolClick += new Infragistics.Win.UltraWinToolbars.ToolClickEventHandler(this.baseToolbarsManager_ToolClick);
		this.QuoteForm.AfterToolClick += new Ice.Lib.Framework.AfterToolClickEventHandler(this.QuoteForm_AfterToolClick);
		this.QuoteQty_Column.ColumnChanged += new DataColumnChangeEventHandler(this.QuoteQty_AfterFieldChange);
		// End Wizard Added Variable Initialization

		// Begin Wizard Added Custom Method Calls

		btnRecalcAll1.Click += btnRecalcAll1_Click;

		//eb1:
		this.oTrans_adapter.AfterAdapterMethod += new AfterAdapterMethod(this.oTrans_adapter_AfterAdapterMethod);

	}

	public void DestroyCustomCode()
	{
		// ** Wizard Insert Location - Do not delete 'Begin/End Wizard Added Object Disposal' lines **
		// Begin Wizard Added Object Disposal

		this.QuoteMtl_Column.ColumnChanged -= new DataColumnChangeEventHandler(this.QuoteMtl_AfterFieldChange);
 
		this.edvJobMtl = null;
 
		this.QuoteMtl_Column.ColumnChanging -= new DataColumnChangeEventHandler(this.QuoteMtl_BeforeFieldChange);
		
	//	this.oTrans_QuoteAdapter_AfterAdapter.AfterAdapterMethod -= new AfterAdapterMethod(this.oTrans_quoteAdapter_AfterAdapter_AfterAdapterMethod);

		this.oTrans_quoteAsmAdapter.BeforeAdapterMethod -= new BeforeAdapterMethod(this.oTrans_quoteAsmAdapter_BeforeAdapterMethod);
		this.oTrans_quoteAsmAdapter = null;

		this.oTrans_quoteAsmAdapter.AfterAdapterMethod -= new AfterAdapterMethod(this.oTrans_quoteAsmAdapter_AfterAdapterMethod);
		this.edvJobMtl.EpiViewNotification -= new EpiViewNotification(this.edvJobMtl_EpiViewNotification);
	//	this.oTrans_adapter.AfterAdapterMethod -= new AfterAdapterMethod(this.oTrans_adapter_AfterAdapterMethod);
		this.oTrans_adapter = null;
		this.epiCheckBoxMtlPricing.Click -= new System.EventHandler(this.epiCheckBoxMtlPricing_Click);
		this.QuoteHed_Column.ColumnChanged -= new DataColumnChangeEventHandler(this.QuoteHed_AfterFieldChange);
		this.baseToolbarsManager.ToolClick -= new Infragistics.Win.UltraWinToolbars.ToolClickEventHandler(this.baseToolbarsManager_ToolClick);
		this.QuoteForm.AfterToolClick -= new Ice.Lib.Framework.AfterToolClickEventHandler(this.QuoteForm_AfterToolClick);
		this.QuoteQty_Column.ColumnChanged -= new DataColumnChangeEventHandler(this.QuoteQty_AfterFieldChange);
		// End Wizard Added Object Disposal

		// Begin Custom Code Disposal

		// End Custom Code Disposal

		btnRecalcAll1.Click -= btnRecalcAll1_Click;

		//eb1:
		this.oTrans_adapter.AfterAdapterMethod -= new AfterAdapterMethod(this.oTrans_adapter_AfterAdapterMethod);

	}

