            string whereClause1 = "PartNum = '"+ PartNumG_look +"'"; //string.Empty;
            //EpiMessageBox.Show(counittype.Text);
            System.Data.DataSet PartAdapter = Ice.UI.FormFunctions.SearchFunctions.listLookup(oTrans, "PartAdapter", out recSelected1, false, whereClause1);
         if (recSelected1 != false)
        {
	
				string PartNumG = Convert.ToString(args.Row["PartNum"]);
				PartAdapter partadG  = new PartAdapter(oTrans);
				partadG.BOConnect();
				System.Data.DataSet datasetG = partadG.GetData(PartNumG);
				
               // DataTable dtG = datasetG.Tables["Part"];
