					edvJobvG.dataView[edvJobvG.Row]["Character03"]=Convert.ToString(dtG.Rows[0]["ShortChar01"]);
					

					string quotenumcdiG = Convert.ToString(edvJobvG.dataView[edvJobvG.Row]["QuoteNum"]);
					string opdesccdiG = Convert.ToString(edvJobvG.dataView[edvJobvG.Row]["Character03"]);
 
					EpiDataView edvJobOpG = (EpiDataView)(oTrans.EpiDataViews["JobOper"]);
