						if (edvJobOpG.dataView[RelCountG]["OpCode"].ToString()== opdesccdiG)
						{
						edvJobvG.dataView[edvJobvG.Row]["RelatedOperation"]=edvJobOpG.dataView[RelCountG]["OprSeq"];
                        OpsNum = Convert.ToInt32(edvJobOpG.dataView[RelCountG]["OprSeq"]);
						//MessageBox.Show("In PartNum change  " + OpsNum.ToString());
						founditG = true;
						}
					}

					if (founditG == false)
					{
						EpiMessageBox.Show("Operation '"+opdesccdiG +"' Not Found. Please Add Operation.");
						oTrans.Delete();
					}	


				//Ok, long story...
				//January 18, 2019
				//If you create a new part and add it to the supplier price list
				//It doesn't pull in a Unit Cost in Quote Material until there has been a material transaction
				//Or until you change QtyPer
				//So I set the default QtyPer back to 0 in Company Config and the code below will change Qtyper to 1
				//and that causes Epicor to pull in the Unit Cost, just like it does in the UI.
				//then I moved that code down into the if statement below

