					partadd = true;
					if (founditG == true)
					{
//
						edvJobvG.dataView[edvJobvG.Row]["QtyPer"]=1;
						edvJobvG.dataView[edvJobvG.Row]["Number01"]=dtG.Rows[0]["Number01"];
		                edvJobvG.dataView[edvJobvG.Row]["Number11"]=CallDynamicQueryAdapterExecuteByIDMethod(PartNumG,quotenumcdiG);
						edvJobvG.dataView[edvJobvG.Row]["Number12"]= Math.Round((Decimal)(Convert.ToDecimal(args.Row["Number11"])/100+1) * Convert.ToDecimal(args.Row["EstMtlUnitCost"]), 2);
						edvJobvG.dataView[edvJobvG.Row]["Number13"]= (Convert.ToDecimal(args.Row["Number01"])) * LaborRate;
						edvJobvG.dataView[edvJobvG.Row]["Number14"]= (Convert.ToDecimal(args.Row["Number12"])) + (Convert.ToDecimal(args.Row["Number13"]));
						edvJobvG.dataView[edvJobvG.Row]["Number15"]= Math.Round((Decimal)(Convert.ToDecimal(args.Row["Number14"])) * Convert.ToDecimal(args.Row["QtyPer"]), 2);

						//Let's run some checks on the data and give a warning if material pricing isn't working as expected - added March 20, 2019
						//If we're using Part Pricing, check to make sure that Material Price is not zero
							//and that it's greater than cost.
						partpricing = Convert.ToBoolean(edvQuoteHed.dataView[edvQuoteHed.Row]["CheckBox01"]);
						if (partpricing)
						{
							if (Convert.ToDecimal(edvJobvG.dataView[edvJobvG.Row]["Number12"]) == 0 || Convert.ToDecimal(edvJobvG.dataView[edvJobvG.Row]["Number12"]) <= Convert.ToDecimal(args.Row["EstMtlUnitCost"]))
