			//Because the query returns the sum BEFORE the current change, I make adjustments for the change.				

				if (InstallSum == 0.0)
					{
					InstallSum = Num1 * Convert.ToDouble(args.Row["QtyPer"]);
					}
				else
					{
					InstallSum = InstallSum - ((installB4 - Num1) * Convert.ToDouble(args.Row["QtyPer"]));
					}

				for ( int RelCountG = 0; RelCountG <= TotalOps-1 ; RelCountG++ )
				{


					if (edvJobOp01.dataView[RelCountG]["OprSeq"].ToString()== RelOpZ.ToString())
					{

					edvJobOp01.dataView[RelCountG]["ProdStandard"] = InstallSum;
					oTrans.Update();

					}
				}
	

				break;

