						EpiDataView edvJobOp = (EpiDataView)(oTrans.EpiDataViews["JobOper"]);
	//					foundit = false;
	
	
	
						//Update Production Standard using BAQ 
						
	
						EpiDataView edvQuoteOPDtl02 = (EpiDataView)(oTrans.EpiDataViews["JobOpDtl"]);
						
						int TotalOps2 = edvJobOp.dataView.Count;
						string OprSeq2 = Convert.ToString(edvJobv.dataView[edvJobv.Row]["RelatedOperation"]);
						//MessageBox.Show(OpsNum.ToString());
						decimal LaborRate02 = Convert.ToDecimal(edvQuoteOPDtl02.dataView[edvQuoteOPDtl02.Row]["ProdLabRate"]);
						string QuoteNum2 = Convert.ToString(args.Row["QuoteNum"]);
						string LineNum2 = Convert.ToString(args.Row["QuoteLine"]);
						string RelOp2 = Convert.ToString(args.Row["RelatedOperation"]);
						double Num2 = (Convert.ToDouble(args.Row["Number01"]));
	
						
	
						double InstallSum2 = CallDynamicQueryAdapterInstallSum(QuoteNum2, LineNum2, RelOp2);
	//					MessageBox.Show("Installsum2 returned as " + Convert.ToString(InstallSum2));
	
						if (InstallSum2 == 0.0)
							{
	//						MessageBox.Show("InstallSum2 = 0.0");
							InstallSum2 = Num2 * Convert.ToDouble(args.Row["QtyPer"]);
	//						MessageBox.Show("Now Installsum2 = " + Convert.ToString(InstallSum2));
							}
						else
							{
	//						MessageBox.Show("else in QtyPer");
	//						MessageBox.Show("Num2 is " +Convert.ToString(Num2));
							InstallSum2 = InstallSum2 - ((qtyperb4 - Convert.ToDouble(args.Row["QtyPer"])) * Num2 );
	//						MessageBox.Show("the else changed InstallSum to " + Convert.ToString(InstallSum2));
							}
	
						for ( int RelCountG = 0; RelCountG <= TotalOps2-1 ; RelCountG++ )
						{
	
	//						MessageBox.Show("OprSeq is " + edvJobOp.dataView[RelCountG]["OprSeq"].ToString() + " RelOp2 = " + RelOp2.ToString());
							if (edvJobOp.dataView[RelCountG]["OprSeq"].ToString()== RelOp2.ToString())
							{
	//						MessageBox.Show(InstallSum2.ToString());
							edvJobOp.dataView[RelCountG]["ProdStandard"] = InstallSum2;
							oTrans.Update();
	//						MessageBox.Show("JobOp OprSeq2 is " + edvJobOp.dataView[RelCountG]["OprSeq"].ToString() + " OprSeq is " + OprSeq2 + " Install Time = " + InstallSum2.ToString());
							}
						}
	
	//						foundit = true;
	//						
	//	
	//					
	//					if (foundit == false)
	//					{
	//						EpiMessageBox.Show("Operation '"+opdesccdi +"' Not Found. Please Add Operation.");
	//						oTrans.Delete();
	//						//oTrans.Clear();
	//						//oTrans.focusLast();
	//					}
	//				}	 
		
				
					//update Extended price
					//JDS 02/03/2020 This SHOULD update extended price AND Material Price.

					edvJobv.dataView[edvJobv.Row]["Number12"]= Math.Round((Decimal)(Convert.ToDecimal(args.Row["Number11"])/100+1) * Convert.ToDecimal(args.Row["EstMtlUnitCost"]), 2); //added 02/03/2020
					edvJobv.dataView[edvJobv.Row]["Number15"]= Math.Round((Decimal)(Convert.ToDecimal(args.Row["Number14"])) * Convert.ToDecimal(args.Row["QtyPer"]), 2);
				
	
	//				partad.Dispose();
//				}
				break;


		}
	}


