		// ** args.MethodName **
		// ** Add Event Handler Code **

		// ** Use MessageBox to find adapter method name
		// EpiMessageBox.Show(args.MethodName)
		switch (args.MethodName)
		{
			case "Delete":
				EpiDataView edvJobv = (EpiDataView)(this.oTrans.EpiDataViews["JobMtl"]);
				totaladel=edvJobv.dataView.Count;
//				EpiMessageBox.Show("Before - "+totalbdel.ToString()+" After - "+totaladel.ToString()+" - "+ opbdel+ " - "+amtbdel.ToString()+" - "+qtyperbd.ToString());

				if (totalbdel!=totaladel)
				{
					if (qtyperbd !=0)
					{
						EpiDataView edvJobOp = (EpiDataView)(oTrans.EpiDataViews["JobOper"]);
						int TotalRel = edvJobOp.dataView.Count;
					
						//EpiMessageBox.Show(TotalRel.ToString());
						for ( int RelCount = 0; RelCount <= TotalRel-1 ; RelCount++ )
						{
						//EpiMessageBox.Show(edvJobOp.dataView[RelCount]["OpCode"].ToString());
						//edvJobOp.dataView.RowFilter="OrderLine="+RelCount.ToString();
						//edvJobOp.dataView.RowFilter="OpCode='"+opdesccdi+"'";
							if (edvJobOp.dataView[RelCount]["OpCode"].ToString()== opbdel)
							{
						
								//edvJobOp.dataView.RowFilter="OpCode='"+opdesccdi+"'";//Van Conv'";//Master'&quo t;;//This is my line of code. 
								Decimal edvjobopprdstd = Convert.ToDecimal(edvJobOp.dataView[RelCount]["ProdStandard"]);
								totalprodstand =0;
								totalprodstand=edvjobopprdstd - amtbdel;
								edvJobOp.dataView[RelCount]["ProdStandard"]=Convert.ToString(totalprodstand);
													
								oTrans.Update();
								
							}
						}
					}
		}
				break;
		}

	}

