	private double CallDynamicQueryAdapterExecuteByIDMethod(string PartNum,string QuoteNum)
	{
		try
		{
			// Declare and Initialize EpiDataView Variables
			// Declare and create an instance of the Adapter.
			DynamicQueryAdapter adapterDynamicQuery = new DynamicQueryAdapter(this.oTrans);
			adapterDynamicQuery.BOConnect();

			EpiDataView edvQH = (EpiDataView)(oTrans.EpiDataViews["QuoteHed"]);

			double markup = 0;
			string QuoteN = QuoteNum.ToString();
			string CustID = 
			CustID = Convert.ToString(edvQH.dataView[edvQH.Row]["CustomerCustID"]);
	
			// Declare and Initialize Variables
			// TODO: You may need to replace the default initialization with valid values as required for the BL method call.
			string BAQName = "AP-QuoteMarkUp02";
			Ice.BO.QueryExecutionDataSet ds = new Ice.BO.QueryExecutionDataSet();

			// Call Adapter method
			//ds.ExecutionParameter.AddExecutionParameterRow("QuoteNum", QuoteNum, "int", false, Guid.Empty, "A");
            ds.ExecutionParameter.AddExecutionParameterRow("PartNum", PartNum, "string", false, Guid.Empty, "A");
			ds.ExecutionParameter.AddExecutionParameterRow("CustID", CustID, "string", false, Guid.Empty, "A");
            
                // Call Adapter method
                adapterDynamicQuery.ExecuteByID(BAQName, ds);
			//adapterDynamicQuery.ExecuteByID(BAQName, ds);

			// Lets Loop through our results
                if (adapterDynamicQuery.QueryResults.Tables["Results"].Rows.Count > 0)
                {
                     foreach (DataRow item in adapterDynamicQuery.QueryResults.Tables["Results"].Rows)
                     {
                     
                         markup = System.Convert.ToDouble(item["Calculated_MarkUpP"]);
                     }
              
                }

			
			// Cleanup Adapter Reference
			adapterDynamicQuery.Dispose();
			
			return markup;
			
		} catch (System.Exception ex)
		{
			ExceptionBox.Show(ex);
			return 0;
		}
	}

	private double CallDynamicQueryAdapterInstallSum(string QuoteNum02, string LineNum02, string RelOp02)
	{
		try
		{
			// Declare and Initialize EpiDataView Variables
			// Declare and create an instance of the Adapter.
			DynamicQueryAdapter adapterDynamicQuery = new DynamicQueryAdapter(this.oTrans);
			adapterDynamicQuery.BOConnect();

			EpiDataView edvQMtl = (EpiDataView)(oTrans.EpiDataViews["QuoteMtl"]);

			double InstallSum = 0;
	
			// Declare and Initialize Variables
			// TODO: You may need to replace the default initialization with valid values as required for the BL method call.
			string BAQName = "AP-SumInstallTime";
			Ice.BO.QueryExecutionDataSet ds = new Ice.BO.QueryExecutionDataSet();

			// Call Adapter method
			ds.ExecutionParameter.AddExecutionParameterRow("QuoteNum", QuoteNum02, "string", false, Guid.Empty, "A");
			ds.ExecutionParameter.AddExecutionParameterRow("LineNum", LineNum02, "string", false, Guid.Empty, "A");
			ds.ExecutionParameter.AddExecutionParameterRow("RelOp", RelOp02, "string", false, Guid.Empty, "A");
            
                // Call Adapter method
                adapterDynamicQuery.ExecuteByID(BAQName, ds);
			//adapterDynamicQuery.ExecuteByID(BAQName, ds);

			// Lets Loop through our results
                if (adapterDynamicQuery.QueryResults.Tables["Results"].Rows.Count > 0)
                {
                     foreach (DataRow item in adapterDynamicQuery.QueryResults.Tables["Results"].Rows)
                     {
                     
                         InstallSum = System.Convert.ToDouble(item["Calculated_InstallSum"]);
                     }
              
                }

			
			// Cleanup Adapter Reference
			adapterDynamicQuery.Dispose();
			
			return InstallSum;
			
		} catch (System.Exception ex)
		{
			ExceptionBox.Show(ex);
			return 0;
		}
	}
	private decimal CallDynamicQuerySumMtlPrice(string QN, string LN)
	{
		try
		{
			// Declare and Initialize EpiDataView Variables
			// Declare and create an instance of the Adapter.
			DynamicQueryAdapter adapterDynamicQuery = new DynamicQueryAdapter(this.oTrans);
			adapterDynamicQuery.BOConnect();

			EpiDataView edvQHed = (EpiDataView)(oTrans.EpiDataViews["QuoteHed"]);
			
			decimal SumMtlPrice = 0;
	
			// Declare and Initialize Variables
			// TODO: You may need to replace the default initialization with valid values as required for the BL method call.
			string BAQName = "AP-QuoteSumMtlPricing";
			Ice.BO.QueryExecutionDataSet ds = new Ice.BO.QueryExecutionDataSet();

			// Call Adapter method
            ds.ExecutionParameter.AddExecutionParameterRow("QuoteNum", QN, "string", false, Guid.Empty, "A");
			ds.ExecutionParameter.AddExecutionParameterRow("QuoteLine", LN, "string", false, Guid.Empty, "A");
            
                // Call Adapter method
                adapterDynamicQuery.ExecuteByID(BAQName, ds);

			// Lets Loop through our results
                if (adapterDynamicQuery.QueryResults.Tables["Results"].Rows.Count > 0)
                {
                     foreach (DataRow item in adapterDynamicQuery.QueryResults.Tables["Results"].Rows)
                     {
                     	SumMtlPrice = System.Convert.ToDecimal(item["Calculated_SumMtlPrice"]);
						//MessageBox.Show(SumMtlPrice.ToString());
                     }
              
                }

			
			// Cleanup Adapter Reference
			adapterDynamicQuery.Dispose();
			
			return SumMtlPrice;
			
		} catch (System.Exception ex)
		{
			ExceptionBox.Show(ex);
			return 0;
		}
	}	
	

	

