					int TotalQLines = edvQDtl.dataView.Count;
					
					if (TotalQLines > 0)
					{				

						for ( int RelCountG = 0; RelCountG <= TotalQLines-1 ; RelCountG++ )
							//write SumMtlPrice to all lines of the quote that return a price > 0
							//the assumption is that if SumMtlPrice = 0 its because there isn't a BoM on that line
						{
	                        try
	                        {
			
								string QN = Convert.ToString(edvQuoteHed.dataView[edvQuoteHed.Row]["QuoteNum"]);
								string LN = Convert.ToString(edvQDtl.dataView[edvQDtl.Row]["QuoteLine"]);

								SumMtlPrice = CallDynamicQuerySumMtlPrice(QN,LN);
								if (SumMtlPrice > 0)
								{	
									//Filter QuoteQty for the row I wast to write to. Assumption is that we only write to OurQuantity = 1
									edvQQty.dataView.RowFilter = "QuoteNum = " +QN+ " AND QuoteLine = " +LN+ " AND OurQuantity = 1";
									edvQQty.dataView[edvQQty.Row]["DocUnitPrice"]= SumMtlPrice;
									oTrans.Update();
								}

							}

							catch (System.Exception ex)
							{
								ExceptionBox.Show(ex);
								//return 0;
							}
						
						}
					
					}

				}
		}
	}






	
