	private void QuoteQty_AfterFieldChange(object sender, DataColumnChangeEventArgs args)
	{
		// ** Argument Properties and Uses **
		// args.Row["FieldName"]
		// args.Column, args.ProposedValue, args.Row
		// Add Event Handler Code

		//This code warns the user that WQUnitPrice is below the worksheet's suggested price when we're not using Material Pricing, which I mistakenly called "part pricing"

		switch (args.Column.ColumnName)
		{
			case "WQUnitPrice":

				if (!partpricing)
				{
					EpiDataView edvQuoteQty = (EpiDataView)(oTrans.EpiDataViews["QuoteQty"]);
					decimal WQUnitPrice = Convert.ToDecimal(args.Row["WQUnitPrice"]);
					decimal PriceTotalCommMarkup = Convert.ToDecimal(args.Row["PriceTotalCommMarkup"]);

					if (WQUnitPrice < PriceTotalCommMarkup)
					{
						EpiMessageBox.Show("Quoted Price " + Convert.ToString(WQUnitPrice) + " is less than Total Price " + Convert.ToString(PriceTotalCommMarkup) + "!");
					}

				}
			
				break;
		}
	}

	//eb1:
	private void oTrans_adapter_AfterAdapterMethod(object sender, AfterAdapterMethodArgs args)
	{
		// ** Argument Properties and Uses **
		// ** args.MethodName **
		// ** Add Event Handler Code **
	
		// **Use MessageBox to find adapter method name
		//MessageBox.Show("otrans after adapter: " + args.MethodName);

		switch (args.MethodName)
		{
			case "DuplicateQuote":
				UnEngineerQuote();
				RecalcMaterialValues();
				break;
		}
	
	}

